import './App.css'

import Picker from '@emoji-mart/react'

const custom = [
  {
    id: 'github',
    name: 'GitHub',
    emojis: [
      {
        id: 'octocat',
        name: 'Octocat',
        keywords: ['github'],
        skins: [
          {
            src: 'https://iconape.com/wp-content/png_logo_vector/github-octocat-logo.png',
          },
        ],
        version: 1,
      },
    ],
  },
]

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Picker custom={custom} maxFrequentRows={0} noCountryFlags={false} />
      </header>
    </div>
  )
}

export default App
